import React from 'react';
import Link from '../../common/Link/Link';
import Icon from '../../common/Icon/Icon';

const FooterServices = ({ content }) => {
  const {
    links: { name, url },
  } = content;
  return (
    <Link link={url} key={name}>
      <Icon name={name} />
    </Link>
  );
};

export default FooterServices;
